export function CompaniesData() {
    return [{
		"id": 0,
		"name": "Entreprise Services CDG"
	},{
		"id": 1,
		"company_name": "Docuprint"
	},{
		"id": 4,
		"company_name": "Forsa Net"
	},{
		"id": 5,
		"company_name": "Emma Productions"
	},{
		"id": 11,
		"company_name": "Spss Maghreb"
	}
]
}

export function renderCompanyName(state, val) {
    return (
        state.name.toString().toLowerCase().indexOf(val.toLowerCase()) !== -1
    );
}
